import classes from './Card.module.css'
import { Link } from 'react-router-dom';
const Card = (props) => {

    return (
        <div onClick={fetchInfo} as={Link} to='auth' className={classes.card}>
            <Link to='/auth'><h3>{props.title}</h3></Link>
            <p>{props.location}</p>
            <p>{props.type}</p>
            <p>{props.description}</p>
        </div>
    )

}


export default Card
